import MealsCart from "./MealsCart";

function Meals() {
  const DUMMY_MEALS = [
    {
      id: "m1",
      name: "Chikken Tikka",
      description: "Grilled Spicy Chicken",
      price: 250,
    },
    {
      id: "m2",
      name: "Biryani",
      description: "Masala Rice with beef",
      price: 220,
    },
    {
      id: "m3",
      name: "Chicken Handi",
      description: "Pakistan special handi",
      price: 450,
    },
    {
      id: "m4",
      name: "Malai Boti",
      description: "Healthy and tendered Chicken",
      price: 300,
    },
  ];
  return (
    <div>
      <MealsCart mealsList={DUMMY_MEALS} />
    </div>
  );
}

export default Meals;
